def downsize(img_data, start_size, target_size):
    """ Take in a picture and downscale it.

    Parameters
    ----------
    img_data : list
        A list of floats or integers representing the greyscale values of an
        image
    start_size : int
        Integer defining the starting length of a square image
    target_size : int
        Integer defining the target length of the new square image

    Returns
    -------
    numpy array
        A flattened array reprsenting the greyscale values of a downsized image

    """
    img_data = np.array(img_data).reshape(start_size, start_size)
    return resize(img_data, (target_size, target_size))


